import React from 'react';
import {connect } from 'react-redux';
import {createPlan} from '../../actions/index';
import PlanForm from './PlanForm';
class PlanCreate extends React.Component{
    onSubmit = (formValues) => {
        this.props.createPlan(formValues)
    }
    render()
        {
        return (<div>
            <h3>Create a Plan</h3>
        </div>);
        }
}
const validate = (formValues)=>{
    const error={};
    if(!formValues.Age)
    {
        error.Age='You must enter the Age';

    }    if(!formValues.Weight)
    {
        error.Weight='You must enter the weight';

    }
    if(!formValues.Height)
    {
        error.Height='You must enter the Height';

    }    if(!formValues.Sex)
    {
        error.Sex='You must enter the Sex';

    }    if(!formValues.Plan)
    {
        error.Plan='You must enter the Plan';

    }
    if(!formValues.Name)
    {
        error.Name='You must enter the Name';

    }
    return error;
};
const formWrapped = reduxForm({
    form:'PLANCREATE',
    validate
})(PlanCreate);
export default connect(null,{createPlan})(formWrapped);
